import React from 'react';
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => ({
    paper: {
        flexGrow: 1,
        padding: theme.spacing(2),
        color: theme.pallette.text.secondary,
        textAlign: 'center',
    },
}));

export default function GridExample() {
    const classes = useStyles();

    return (
        <div>
            <Grid 
                container 
                spacing={2}
            >
                <Grid 
                    item 
                    xs={12}
                >
                    <Paper 
                        className={classes.paper} 
                        elevation={3}
                    >
                        <Typography 
                            variant='body1' 
                            component='p' 
                        >
                            xs-12 
                        </Typography>
                    </Paper>
                </Grid>
                <div>
                    {[1, 2].map((item, index) => {
                        return (
                            <Grid 
                                item 
                                xs={6} 
                                key={index.toString()}
                            >
                                <Paper 
                                    className={classes.paper} 
                                    elevation={3}
                                >
                                    <Typography 
                                        variant='body1' 
                                        component='p' 
                                    >
                                        xs-6
                                    </Typography>
                                </Paper>
                            </Grid>
                        );
                    })}
                </div>
                <div>
                    {[1, 2, 3, 4].map((item, index) => {
                        return (
                            <Grid 
                                key={index.toString()}
                                item 
                                xs={3} 
                            >
                                <Paper 
                                    className={classes.paper}
                                    elevation={3}
                                >
                                    <Typography 
                                        variant='body1' 
                                        component='p' 
                                    >
                                        xs-3
                                    </Typography>
                                </Paper>
                            </Grid>
                        );
                    })}
                </div>
            </Grid>
        </div>
    );
}
